import React, { useState } from 'react';
import '../../styles/CalendarView.css';

const CalendarView = () => {
  const daysOfWeek = ['Mon', 'Tues', 'Wed', 'Thurs', 'Fri', 'Sat', 'Sun'];
  const [selectedDay, setSelectedDay] = useState(28); // Default to the 28th

  // Sample data for the calendar days
  const calendarDays = [
    { day: 'Mon', date: 25, appointments: [{time: '10:00'}, {time: '11:00'}, {time: '12:00'}] },
    { day: 'Tues', date: 26, appointments: [{time: '08:00'}, {time: '09:00'}, {time: '10:00'}] },
    { day: 'Wed', date: 27, appointments: [{time: '12:00'}, {time: '13:00'}] },
    { day: 'Thurs', date: 28, appointments: [{time: '10:00'}, {time: '11:00'}, {time: '13:00'}] },
    { day: 'Fri', date: 29, appointments: [{time: '14:00'}, {time: '16:00'}] },
    { day: 'Sat', date: 30, appointments: [{time: '12:00'}, {time: '14:00'}, {time: '15:00'}] },
    { day: 'Sun', date: 31, appointments: [{time: '09:00'}, {time: '10:00'}, {time: '11:00'}] },
  ];

  // Time slots from 8:00 to 17:00
  const timeSlots = [
    '08:00', '09:00', '10:00', '11:00', '12:00', '13:00', '14:00', '15:00', '16:00', '17:00'
  ];

  // Check if a day has an appointment at a specific time
  const hasAppointment = (day, time) => {
    return day.appointments.some(apt => apt.time === time);
  };

  return (
    <div className="calendar-view">
      <div className="calendar-header">
        <div className="calendar-navigation">
          <button className="nav-arrow prev-arrow">
            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
              <path d="M15 18l-6-6 6-6" />
            </svg>
          </button>
          <h2 className="month-year">May 2025</h2>
          <button className="nav-arrow next-arrow">
            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
              <path d="M9 18l6-6-6-6" />
            </svg>
          </button>
        </div>
      </div>

      <div className="new-calendar-grid">
        {/* Day headers */}
        <div className="calendar-days-header">
          {calendarDays.map((day) => (
            <div 
              key={day.date} 
              className={`calendar-day-header ${day.date === selectedDay ? 'selected' : ''}`}
              onClick={() => setSelectedDay(day.date)}
            >
              <div className="day-name">{day.day}</div>
              <div className="day-date">{day.date}</div>
            </div>
          ))}
        </div>

        {/* Time slots grid */}
        <div className="calendar-time-grid">
          {/* Time labels column */}
          <div className="time-labels-column">
            {timeSlots.map(time => (
              <div key={time} className="time-label">{time}</div>
            ))}
          </div>

          {/* Day columns with appointments */}
          {calendarDays.map(day => (
            <div 
              key={day.date} 
              className={`day-column ${day.date === selectedDay ? 'selected' : ''}`}
            >
              {timeSlots.map(time => {
                const hasAppt = hasAppointment(day, time);
                return (
                  <div 
                    key={`${day.date}-${time}`} 
                    className={`time-slot ${hasAppt ? 'has-appointment' : ''}`}
                  >
                    {hasAppt ? (
                      <div className="appointment-pill">{time}</div>
                    ) : (
                      <div className="empty-slot-line"></div>
                    )}
                  </div>
                );
              })}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CalendarView;
